public void run() {

    this.setSize(500, 700);
    this.setFont("Arial-16");
    //main body, asking x and epsilon, than outputting the calculation's result with recursion,recurrence and math.pow
    while (true) {
      println("The program calculates e^x");
      double x = readDouble("Enter the x[0;1): ");
      //in case entered x is not right
       while (!(0 < x & x <=1)) {
            println("Entered number is less or more than [0;1)");
          double x1 = readDouble("Enter the x[0;1): ");
          x=x1;
          }
      double ep = readDouble("Enter the precision: ");
      //in case entered epsilon is not right
      while (ep <= 0) {
            println("You should enter the positive number.");
            double ep1 = readDouble("Enter the precision: ");
            ep=ep1;
          }

      double sum = 1;
      double n = 1;
      double prev = 1;

      println("--------------------------------------------------");
      println("Recursion: " + recursion(sum, x, ep, prev, n));
      println("Recurrence: " + recurrence(sum, x, ep, prev, n));
      println("Math.pow: " + Math.pow(Math.E, x));
      println("--------------------------------------------------");

      restart();
    }

  }
  //method for restarting the program
  private void restart() {
    int restart = readInt("Print 1 to restart: ");
    if (restart == 1) {
      return;
    }
  }
  //recursion
  private double recursion(double sum, double x, double ep, double prev, double n) {
    double current = prev * x / n;
    sum = sum + current;
    if (current < ep) {
      return sum;
    }
    return recursion(sum, x, ep, current, n + 1);
  }
  //recurrence
  private double recurrence(double sum, double x, double ep, double prev, double n) {
    double current = 1;
    while (current > ep) {
      current = prev * x / n;
      sum = sum + current;
      n++;
      prev = current;
    }
    return sum;
  }
